;; gorilla-repl.fileformat = 1

;; **
;;; # Example 1: Linear Regression
;; **

;; @@
(use 'nstools.ns)
(ns+ linear
  (:like anglican-user.worksheet))
;; @@
;; =>
;;; {"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"},{"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}],"value":"[nil,nil]"}
;; <=

;; **
;;; We start with the linear regression model in slides except that we express it in the function-returning form.
;; **

;; @@
(defquery linear-regression []
  (let [s (sample (normal 0. 2.))
        b (sample (normal 0. 6.))
        f (fn [x] (+ (* s x) b))]
    
    (observe (normal (f 0.) 0.5) 0.6)
    (observe (normal (f 1.) 0.5) 0.7)
    (observe (normal (f 2.) 0.5) 1.2)
    (observe (normal (f 3.) 0.5) 3.2)
    (observe (normal (f 4.) 0.5) 6.8)
    (observe (normal (f 5.) 0.5) 8.2)
    (observe (normal (f 6.) 0.5) 8.4)
    f))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;linear/linear-regression</span>","value":"#'linear/linear-regression"}
;; <=

;; **
;;; We now perform inference and generate lazy samples, and retrieve 1000 samples from the lazy sequence.
;; **

;; @@
(def lazy-samples 
  (drop 1000 
        (doquery :lmh linear-regression [])))

(def f-samples
  (map :result 
       (take 1000 
             (take-nth 20 lazy-samples))))
;; @@
;; =>
;;; {"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"html","content":"<span class='clj-var'>#&#x27;linear/lazy-samples</span>","value":"#'linear/lazy-samples"},{"type":"html","content":"<span class='clj-var'>#&#x27;linear/f-samples</span>","value":"#'linear/f-samples"}],"value":"[#'linear/lazy-samples,#'linear/f-samples]"}
;; <=

;; **
;;; We define a few auxiliary functions to undo the CPS transformation by the Anglican compiler.
;; **

;; @@
(defn cont [x y] x)

(def state nil)

(defn apply-f 
  [f x]
  (trampoline (f cont state x)))
;; @@
;; =>
;;; {"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"html","content":"<span class='clj-var'>#&#x27;linear/cont</span>","value":"#'linear/cont"},{"type":"html","content":"<span class='clj-var'>#&#x27;linear/state</span>","value":"#'linear/state"}],"value":"[#'linear/cont,#'linear/state]"},{"type":"html","content":"<span class='clj-var'>#&#x27;linear/apply-f</span>","value":"#'linear/apply-f"}],"value":"[[#'linear/cont,#'linear/state],#'linear/apply-f]"}
;; <=

;; **
;;; We visualise the sampled functions.
;; **

;; @@
(def xs (range -1 8 0.1))

(defn draw [f]
  (let [ys (map (partial apply-f f) xs)
        xys (map (fn [x y] [x y]) xs ys)]
    (plot/list-plot xys 
                    :joined true 
                    :opacity 0.02 
                    :plot-range [[-2 8] [-3 10]])))

(def xss [0 1 2 3 4 5 6])
(def drawpoints 
  (let [ys [0.6 0.7 1.2 3.2 6.8 8.2 8.4]
        xys (map (fn [x y] [x y]) xss ys)]
    (plot/list-plot xys 
                    :joined false 
                    :color "black" 
                    :plot-range [[-1 8] [-3 10]]
                    )))

(reduce plot/compose 
        (concat (map draw f-samples) 
                [drawpoints]))
