(defquery linear-regression-prior
  (let [s (sample (normal 0.0 2.0))
        b (sample (normal 0.0 6.0))
        f (fn [x] (+ (* s x) b))]
    f))

(def prior-lazy-samples 
  (drop 1000 (doquery :lmh linear-regression-prior [])))

(def prior-f-samples 
  (map :result (take 1000 
                     (take-nth 20 prior-lazy-samples))))

