(defm add-change-points [F l u]
  (if (sample (flip 0.5)) (F)
    (if (sample (flip 0.5))
       (let [cp1 (sample
                   (uniform-continuous l u))
             f1 (F)
             f2 (F)]
         (fn [x] (if (< x cp1) (f1 x) (f2 x))))
       (let [cp1 (sample
                   (uniform-continuous l u))
             cp2 (sample
                   (uniform-continuous cp1 u))
             f1 (F)
             f2 (F)
             f3 (F)]
         (fn [x] (if (< x cp1) (f1 x)
                    (if (< x cp2) (f2 x)
                       (f3 x))))))))
    
(defquery linear-regression-changepoints
  (let [F (fn []
            (let [s (sample (normal 0.0 3.0))
                  b (sample (normal 0.0 3.0))]
              (fn [x] (+ (* s x) b))))
        f (add-change-points F 0 6)]
    (observe (normal (f 0.0) 0.5) 0.6)
    (observe (normal (f 1.0) 0.5) 0.7)
    (observe (normal (f 2.0) 0.5) 1.2)
    (observe (normal (f 3.0) 0.5) 3.2)
    (observe (normal (f 4.0) 0.5) 6.8)
    (observe (normal (f 5.0) 0.5) 8.2)
    (observe (normal (f 6.0) 0.5) 8.4)
    f))
